    render(){
        return(
            <div>
                {profiles.map((profile)=>{
                    const userName = users[profile.userID].name;
                    const favMovie = movies[profile.favoriteMovieID].name;
                    return(
                        <ul key={profile.id}>
                            <p>{`${userName}, ${favMovie}`}</p>
                        </ul>
                    )
                })}
            </div>
        )
    }
}

